Sure, I can help you create a data model for a test automation tool. Let's break down the key entities, their attributes, and relationships:

1. **Organization** - An organization holds multiple tests and goals.
2. **User** - A user has multiple roles, which may include creating, executing, or managing tests, goals, and tests within projects.
3. **Project** - A project holds multiple tests.
4. **Goal** - A goal holds multiple tests within it.
5. **Test** - A test represents a specific action (e.g., a function call, a database query) and can be executed with a particular test case.
6. **Execution** - An execution can be associated with a test, and it may have a passed or failed status.

### Relationships

- **One-to-One**: A user can have one project, but a project can have multiple users. Similarly, a goal can have multiple tests.
- **One-to-Many**: A goal can have many tests, but a goal can only have one user. The same goes for a test, although in practice, a test might belong to multiple goals and projects.
- **Many-to-Many**: Users and goals can create many tests, and tests can belong to many goals and projects.

### Data Model

**Table Definitions**

| Key                 | Table Name                  | Attributes  |
|----------------------|------------------------|------------|
| Organization         | Organization           | - organization_id   |
| User                  | User                    | - user_id       |
| Project             | Project               | - project_id      |
| Goal               | Goal                   | - goal_id        |
| Test               | Test                 | - test_id      |
| Execution         | Execution           | - execution_id   |
| TestGoal         | TestGoal           | - test_id        |
| Task              | Task               | - task_id     |

### Relationships

- **Organization** contains **User** and **Project**.
- **User** contains **Organization** and **Project**.
- **Organization** contains **Goal** and **Test**.
- **Test** contains **Execution**.
- **Execution** contains **Test**.

