```js
const { Client, ClientError, Context } = require('discord.js');
const { ClientOAuth, Channel, ServerUrl } = require('discord-chat');

async function runBan(ctx, banArgs) {
    try {
        const bot = new Client();
        const client = new ClientOAuth(bot);

        const channel = await bot.getChannel(ctx.channel.id);
        const bannedUser = await client.getFriends(ctx.guild).find(name => name === banArgs.username);

        if (bannedUser) {
            await channel.removeUser(bannedUser.id);
            await client.logout();
        } else {
            console.error(`Username ${banArgs.username} not found in the server.');
        }
    } catch (error) {
        console.error('Something went wrong', error);
        await client.close();
    }
}

module.exports = async function runBan(ctx, banArgs) {
