To create a first-person controller script for Godot Engine 3.x and apply it to a `KinematicBody-node` in Godot Engine 3.x, you need to understand that the underlying mechanisms and node structures have changed. In Godot Engine 4.x, the `KinematicBody` has been replaced with a `DynamicBody`.

Here’s a step-by-step guide on how to achieve this:

### Godot Engine 3.x Script

1. **Import Required Nodes:**
   First, ensure you have `KinematicBody` and `Controller` imported.

   ```gdscript
   import KinematicBody
   import Controller
   ```

2. **Create a First Person Controller Script:**
   Create a new script named `FirstPersonController` to handle the game controller input.

   ```gdscript
   class FirstPersonController extends Controller {
       var speed: float = 1.0
       var gravity: float = -9.8

       function init(self):
           self.SetActorType(self.GetActor(0))
           self.SetGravity(gravity)
       function Update(self, dt):
           if (self.isMoving) {
               // Handle movement
               self.AddVector(Vector3.UP * speed)
               Vector3.forward(self.GetCamera()->getLookAtVector(Vector3.UP))
           }

           if (self._physicsBody == KinematicBody::DefaultPhysicsBody) {
               // Handle jumping
               self._physicsBody = KinematicBody::DefaultPhysicsBody()
               self.AddVector(Vector3.UP * speed)
               self._physicsBody.MoveTo(Vector3.UP * speed * 0.7f)
           }
       }
   }
   ```

3. **Add the Controller Script to the `KinematicBody-node:**
   Set the controller script to the first child node of the `KinematicBody-node`.

   ```gdscript
   class Controller extends Controller {
       function init(self):
           self.SetActorType(self.GetActor(0))
       function Update(self, dt):
           self.SetPhysicsBody(self.GetPhysicsBody())
       }
   }
   ```

### Equivalent in Godot Engine 4.x

In Godot Engine 4.x, `KinematicBody` has been replaced with `DynamicBody`. Below is how you can adapt the script from Godot Engine 3.x to use `DynamicBody` in Godot Engine 4.x:

1. **Import Required Nodes:**
   Ensure you have `KinematicBody` and `DynamicBody` imported.

   ```gdscript
   import KinematicBody
   import DynamicBody
   ```

2. **Create a Dynamic First Person Controller Script:**
   Create a new script named `FirstPersonControllerDynamic` to handle the game controller input.

   ```gdscript
   class FirstPersonControllerDynamic extends DynamicBody::Entity {
       var speed: float = 1.0
       var gravity: float = -9.8

       function init(self):
           self.AddActor(actor: FirstPersonController, transform: Transform3F())
       function Update(self):
           if (self.isMoving) {
               // Handle movement
               self.AddVector(Vector3.UP * speed)
               Vector3.forward(self.GetLookAtVector(Vector3.UP))
           }

           if (self._physicsBody == KinematicBody::DefaultPhysicsBody) {
               // Handle jumping
               self._physicsBody = KinematicBody::DefaultPhysicsBody()
               self.AddVector(Vector3.UP * speed)
               self._physicsBody.MoveTo(Vector3.UP * speed * 0.7f)
           }
       }
   }
   ```

3. **Add the Controller Script to the DynamicBody-node:**
   Set the controller script to the first child node of the `DynamicBody-node`.

   ```gdscript
   class ControllerDynamic extends DynamicBody::Entity {
       var speed: float = 1.0
       var gravity: float = -9.8

       function init(self):
           self.AddActor(actor: FirstPersonControllerDynamic, transform: Transform3F())
       function Update(self):
           if (self.isMoving) {
               self.AddVector(Vector3.UP * speed)
               Vector3.forward(self.GetLookAtVector(Vector3.UP))
           }

           if (self._physicsBody == KinematicBody::DefaultPhysicsBody) {
               self._physicsBody = KinematicBody::DefaultPhysicsBody()
               self.AddVector(Vector3.UP * speed)
               self._physicsBody.MoveTo(Vector3.UP * speed * 0.7f)
           }
       }
   }
   ```

