#include <iostream>
#include <fstream>
#include <string>
#include <vector>
#include <unordered_map>

int main() {
    std::string word;
    std::string line;
    std::unordered_map<std::string, int> wordCount;

    std::cout << "Enter the word to count: ";
    std::getline(std::cin, word);

