        std::transform(word.begin(), word.end(), word.begin(), ::tolower);

        if (line.find(word) != std::string::npos) {
            wordCount[line]++;
        }
    }

    std::cout << "The word \"" << word << "\" occurs " << wordCount[word] << " times in the file." << std::endl;

    file.close();
    return 0;
}
